                z-index: 12;
            }
            :nth-child(4){
                z-index: 11;
            }

            .image-container__main_img{
                position: absolute;
                height: inherit;
                //width: 100%;
                border-top-left-radius: 4px;
                border-top-right-radius: 4px;
            }
        }

        [id^=slider__left-area-button]{
            cursor: pointer;
            z-index: 16;
            border-top-left-radius: 4px;
            position: absolute;
            top: 0px;
            left: 0px;
            width: 42px;
            height: 100%;
            background: linear-gradient(90deg, rgba(0, 0, 0, 0.5) 0%, rgba(0, 0, 0, 0) 99.99%, rgba(255, 255, 255, 0) 100%);
        }

        [id^=slider__right-area-button]{
            cursor: pointer;
            z-index: 16;
            border-top-right-radius: 4px;
            position: absolute;
            top: 0px;
            right: 0px;
            width: 42px;
            height: 100%;
            background: linear-gradient(-90deg, rgba(0, 0, 0, 0.5) 0%, rgba(0, 0, 0, 0) 99.99%, rgba(255, 255, 255, 0) 100%);
        }
        
        [id^=slider__left-button]{
            transform: rotate(90deg);
            top: 0;
            bottom: 0;
            left: 10px;
            margin: auto;
        }

        [id^=slider__right-button]{
            transform: rotate(-90deg);
            top: 0;
            bottom: 0;
            right: 0px;
            margin: auto;
        }
     
        .material-icons{
            -webkit-user-select: none;
            cursor: pointer;
            z-index: 20;
            font-style: normal;
            font-weight: normal;
            text-align: center;
            height: 24px;
            font-size: 24px;
            line-height: 24px;
            color: #FFFFFF;
            position: absolute;
        }

        .slider__legend{
            z-index: 15;
            margin-block-start: 0em;
            margin-block-end: 0em;
            margin-inline-start: 0px;
            margin-inline-end: 0px;
            padding-inline-start: 0px;
            list-style-type: none;
            position: absolute;
            width: 47px;
            height: 7.5px;
            bottom: 20px;
            right:15px;
            
            .legend__el{
                margin-right: 3.75px;
                text-align: center;
                display: inline-block;
                border: 1px solid #FFFFFF;
                border-radius: 50%;
                width: 6.5px;
                height: 6.49px;
            }
            :first-child{
                background: white;
            }
            :last-child{
                margin-right: 0px;
            }
        }
    }
    
    .room__description-container{
        width: 100%;
        display: flex;
        flex-direction: column;
        justify-content: center;

        .room__up-container{
            display: flex;
            flex-direction: row;
            //margin-top: 7.4%;
            margin-left: 7.4%;
            margin-right: 7.4%;
            padding-bottom: 3.7%;
            border-bottom: 1px solid rgba(31, 32, 65, 0.1);

            .up-container__type{
                margin-right: auto;

                :first-child{
                    font-family: Open Sans;
                    margin-right: 5px;
                    color: #1F2041;
                    font-weight: bold;
                    font-size: 14px;
                    line-height: 17px;
                }
                
                :last-child{
                    line-height: 17px;
                    font-weight: bold;
                    font-size: 12px;    
                    color: #BC9CFF;
                }
            }

            .up-container__price{

                :first-child{
                    //font-family: Quicksand;
                    line-height: 18px;
                    margin-right: 5px;
                    color: rgba(31, 32, 65, 0.5);
                    font-weight: bold;
                    font-size: 14px;
                }
                
                :last-child{
                    line-height: 18px;
                    font-size: 14px;    
                    color: rgba(31, 32, 65, 0.5);
                }
            }
        }

        .room__down-container{
            display: flex;
            flex-direction: row;
            align-content: center;
            align-items: center;
            margin-top: 2.9%;
            margin-left: 7.4%;
            margin-right: 7.4%;
            //padding-bottom: 7.7%;

            .down-container__rating{
                margin-right: auto;
                height: 24px;

                .down-container__star-elemet{
                    background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%) !important;
                    -webkit-background-clip: text !important; 
                    -webkit-text-fill-color: transparent; 
                }
            }

            .down-container__rewiews{
                color: rgba(31, 32, 65, 0.5);
                font-weight: bold;
                font-size: 14px;
                line-height: 18px;
            }
        }
    }
}

sources.ui_kit\\calendar\\_calendar.scss:
.calendar{
    background: #FFFFFF;
    border: 1px solid rgba(31, 32, 65, 0.25);
    box-sizing: border-box;
    box-shadow: 0px 10px 20px rgba(31, 32, 65, 0.05);
    border-radius: 4px;
    padding-left: 20px;
    padding-right: 20px;

    .calendar__selector{
        display: flex;
        align-items: center;
        justify-content: space-between;
        margin-top: 20px;
        margin-bottom: 30px;

        .calendar__date{
            font-style: normal;
            font-weight: bold;
            font-size: 19px;
            line-height: 24px;
        }

        .material-icons.calendar-arrow {
            width: 44px;
            text-align: center;
            background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
            -webkit-background-clip: text;
            -webkit-user-select: none; 
            -webkit-text-fill-color: transparent; 
            display: initial; 
        }
    }

    .calendar__main{
        .calendar__days-name{
            font-family: Montserrat;
            display: flex;
            flex-direction: row;
            justify-content: space-around;

            * { 
                height: 40px;
                line-height: 40px;
                font-style: normal;
                font-weight: bold;
                font-size: 12px;    
                color: #BC9CFF;
            }
        }
        .calendar__days{
            display: flex;
            flex-direction: row;
            flex-wrap: wrap;
        
            .day{
                cursor: pointer;
                -webkit-user-select: none;
                text-align: center;
                //line-height: 40px;
                font-style: normal;
                font-weight: normal;
                font-size: 12px;
                width: 14.2%;     
            }

            //   
            .pushed-up{
                background: linear-gradient(180deg, #6FCF97 0%, #66D2EA 100%);
                border-radius: 22px;
                color: #FFFFFF !important;
            }

            .pushed-down{
                background: linear-gradient(180deg, rgba(111, 207, 151, 0.445) 0%, rgba(102, 210, 234, 0.466) 100%);
                border-radius: 22px;
                color: #FFFFFF !important;
            }

            .mouse-on{
                background: rgba(145, 145, 145, 0.11);
                border-radius: 22px;
            }

            .other-month-day{
                color: rgba(31, 32, 65, 0.25);
            }

            .curr-month-day{
                color: rgba(31, 32, 65, 0.5);
            }

            .selected-day{
                z-index: 10;
                font-weight: bold;
                border-radius: 22px;
                color: #FFFFFF !important;
                background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%) !important;
            }

            .selected-day-in-period{
                position: relative;
                z-index: 10;
                font-weight: bold;
                border-radius: 22px;
                color: #FFFFFF !important;
                background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%) !important;
            }

            .selected-day-in-period.start::before{
                width: 20px;
                height: inherit;
                content: '';
                right: 0px;
                z-index: -1;
                position: absolute;
                border-radius: 0px;
                background: linear-gradient(180deg, rgba(188, 156, 255, 0.25) 0%, rgba(139, 164, 249, 0.25) 80%);
            }

            .selected-day-in-period.end::before{
                width: 20px;
                height: inherit;
                content: '';
                left: 0px;
                z-index: -1;
                position: absolute;
                border-radius: 0px;
                background: linear-gradient(180deg, rgba(188, 156, 255, 0.25) 0%, rgba(139, 164, 249, 0.25) 80%);
            }

            .day-in-period{
                background: linear-gradient(180deg, rgba(188, 156, 255, 0.25) 0%, rgba(139, 164, 249, 0.25) 80%);
            }
        }
        
    }
    @import "../buttons/clear-accept-buttons/clear-accept-buttons";
    
    .calendar__down-buttons{
        margin-top: 20px;
        margin-bottom: 20px;
    }
}

