sources.search_room_page\\search_room_page.scss:
@import "../ui_kit/header/header-registration/header-registration";
@import "../ui_kit/footer/footer_elements/footer-main-content/footer-main-content";
@import "../ui_kit/footer/footer_elements/footer-underline-content/footer-underline-content";
@import "../ui_kit/fonts/Material_Icons/material-icons.css";
@import "../ui_kit/room_element/room.scss";
@import "../ui_kit/calendar/calendar";
@import "../ui_kit/list-of-counted-items/list-of-counted-items";
@import "../ui_kit/jq/styles/jquery-ui.css";
@import "../ui_kit/checkbox/checkbox.scss";
@import "../ui_kit/input_fields/one_place/one_place_input.scss";
@import "../ui_kit/text-header-style/text-header-style.scss";

@import "../ui_kit/fonts/montserrat/montserrat.css";
@import "../ui_kit/fonts/openSans/opensans.css";

* {
    font-family: Montserrat;
}

.main{
    background: white;
    margin-bottom: 70px;
    display: flex;
    
    .main__navigation-bar{
        width: 266px;
        margin-top: 30px;
        margin-left: 7.5%;
        position: relative;
        
        .navigation-bar-date__one-input{
            margin-top: 0px;
        }

        .navigation-bar__calendar{
            display: none;
            width: 266px;
            position: absolute;
            top: 70px;
            z-index: 20;
        }

        .navigation-bar__people-list{
            display: none;
            position: absolute;
            width: 264px;
            top: 140px;
            z-index: 15;
        }

        .navigation-bar__room-list{
            display: none;
            position: absolute;
            width: 264px;
            top: 668px;
            z-index: 15;
        }

        //    ///////////////////////
        .navigation-bar__window-input-description{
            font-style: normal;
            font-weight: bold;
            font-size: 12px;
            line-height: 15px;  
            color: #1F2041;
        }

        
        
        .one-input-field{
            width: 264px;
        }

        
        .navigation-bar__window-input{
            border: 1px solid rgba(31, 32, 65, 0.25);
            width: 264px;
            border-radius: 4px;
            display: flex;
            align-content: center;

            .navigation-bar__window-input-field{
                margin-right: auto;
                background: none;
                border: none;
                box-sizing: border-box;
                padding-left: 13px;
                text-overflow: ellipsis;
                width: 220px;
                font-style: normal;
                font-weight: normal;
                font-size: 14px;
                line-height: 24px;
                color: rgba(31, 32, 65, 0.75);
            }

            .window-input-expand-elemet{
                -webkit-user-select: none;
                cursor: pointer;
                text-align: center;
                line-height: 44px;
                width: 44px;
                color: rgba(31, 32, 65, 0.5);
            }
        }

        .navigation-bar__slider-description{
            margin-top: 30px;
            position: relative;
            width: 266px;
            height: 15px;

            .navigation-bar__slider-description-row{
                left: 0px;
                width: 121px;
                height: 15px;
            }

            .navigation-bar__slider-values{
                position: absolute;
                right: 0px;
                width: 102px;
                height: 15px;
                border: none;

                font-style: normal;
                font-weight: normal;
                font-size: 12px;
                line-height: 15px;
                text-align: right;
                text-transform: uppercase;
                color: rgba(31, 32, 65, 0.5);
            }
        }
        //////////////////////////////////////////////////////

        .navigation-bar__slider{
            margin-top: 24px;
            
            #slider{
                width: 266px;
                height: 6px;
            }

            .ui-slider{
                border: 1px solid rgba(31, 32, 65, 0.25);
                border-radius: 3px;
            }
            .ui-slider-range{
                background: linear-gradient(180deg, #6FCF97 0%, #66D2EA 100%);
            }

            .ui-slider-handle{
                width: 12px;
                height: 12px;
                background: linear-gradient(180deg, #6FCF97 0%, #66D2EA 100%);
                border: 2px solid #FFFFFF;
                border-radius: 10px;
            }
        }

        .navigation-bar__slider-annotation{
            margin-top: 13px;
            width: 264px;
            height: 14px;
            font-style: normal;
            font-weight: normal;
            font-size: 12px;
            line-height: 14px;

            color: rgba(31, 32, 65, 0.5);
        }

        .navigation-bar__options-description{
            margin-top: 30px;
            left: 0px;
            width: 121px;
        }

        .navigation-bar__options{
            
            .navigation-bar__smoke-option.checkbox-container{  
                margin-top: 17px;
                width: 266px;
            }
            .navigation-bar__pet-option.checkbox-container{
                margin-top: 10px;  
                width: 266px;
            }
            .navigation-bar__guests-option.checkbox-container{  
                margin-top: 10px;    
                width: 266px;
                .checkbox{
                    align-self: flex-start;
                }
            }
        }

        .navigation-bar__availability-options-description{
            margin-top: 30px;
            left: 0px;
            width: 121px;
            height: 15px;
        }

        .navigation-bar__availability-options{
            width: 266px;
            display: flex;
            flex-direction: column;
            
            .navigation-bar__wide-option.checkbox-container{  
                margin-top: 17px;
                width: 266px;
            }
            .navigation-bar__helper-option.checkbox-container{
                margin-top: 10px;  
                width: 266px;
            }

            .checkbox-descritpion{
                font-weight: bold;
                color: rgba(31, 32, 65, 0.75);
            }

            .navigation-bar__chekbox-addition{
                align-self: flex-start;
                margin-top: 5px;
                margin-left: 12%;
                font-style: normal;
                font-weight: normal;
                font-size: 12px;
                line-height: 14px;
                color: rgba(31, 32, 65, 0.5);
            }
        }

        .navigation-bar__room-input-description{
            margin-top: 30px;
            margin-bottom: 5px;
        }

        .navigation-bar__additional-options{
            margin-top: 30px;
            width: 266px;
            height: 15px;
            display: flex;
            flex-direction: row;
            align-items: center;
            cursor: pointer;

            .navigation-bar__additional-options-description{
                margin-right: auto;
                margin-bottom: 0px;
            }

            .additional-options-expand-elemet{
                -webkit-user-select: none;      
                text-align: center;
                line-height: 44px;
                width: 44px;
                color: rgba(31, 32, 65, 0.5);
            }
        }

        .navigation-bar__list-of-additional-options{
            display: none;
            margin-top: 17px;
            :first-child{
                margin-top: 0px !important;
            }
            .slide_down_check.checkbox-container{
                margin-top: 10px;
                //height: 30px;
            }
        }
        

    }

    .main__room-place{
        display: flex;
        flex-direction: column;
        align-items: flex-start;
        margin-top: 30px;
        margin-left: 59px;
        
        .main__room-description{
            margin-left: 12px;
        }

        .main__room-container{
            width: 100%;
            display: flex;
            flex-direction: row;
            flex-wrap: wrap;

            [class^=room-]{
                margin: 21px 12px;
            }
        }

        .main__room_pages{
            display: flex;
            flex-direction: row;
            width: 240px;
            height: 40px;

            .main__room_page{
                border-radius: 22px;
                font-style: normal;
                font-weight: normal;
                font-size: 12px;
                color: rgba(31, 32, 65, 0.5);
                line-height: 40px;
                height: 40px;
                width: 40px;
                text-align: center;
            }

            .main__room_page.current_page{
                background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
                color: #FFFFFF;
            }

            .main__room_page.page_next_button{
                background: linear-gradient(180deg, #6FCF97 0%, #66D2EA 100%);
                color: #FFFFFF;
                font-size: 24px;
            }
        }

        .main__room_pages_description{
            margin-top: 10px;
            width: 240px;
            text-align: center;
            font-style: normal;
            font-weight: normal;
            font-size: 14px;
            color: rgba(31, 32, 65, 0.75);
        }

    }
}
@media all and (max-width: 991px){
    .main__room-place{
        .main__room-container{
            flex-direction: column !important;
            align-items: center;

            [class^=room-]{
                width: 80%;
                
                i .material-icons{
                    font-size: 30px; 
                }

                div .up-container__type {
                    * {
                        font-size: 17px;
                    }
                }

                div .up-container__price {
                    * {
                        font-size: 17px;
                    }
                }

                div .down-container__rewiews{
                    * {
                        font-size: 17px;
                    }
                }
                div .down-container__rating{
                    * {
                        font-size: 24px;
                    }
                }
            }
        }

        .main__room_pages{
            margin-left: 0px !important;
            align-self: center !important;
        }

        .main__room_pages_description{
            margin-left: 0px !important;
            align-self: center !important;
        }
    }
}

@media all and (max-width: 742px){
    .main{
        flex-direction: column;
        align-content: center;
        align-items: center;

        .main__navigation-bar{
            margin-left: 0px;
        }
        .main__room-place{
            margin-left: 0px;

            .main__room-description{
                margin-left: 0px;
            }
        }
    }
}

@media all and (max-width: 455px){
    .main__room-description{
        font-size: 20px !important;
        text-align: center; 
    }
    [class^=room-]{
        i .material-icons{
            font-size: 30px !important; 
        }

        div .up-container__type {
            * {
                font-size: 13px !important;
            }
        }

        div .up-container__price {
            * {
                font-size: 13px !important;
            }
        }

        div .down-container__rewiews{
            * {
                font-size: 13px !important;
            }
        }
        div .down-container__rating{
            * {
                font-size: 20px !important;
            }
        }
    }
}
